import { UserActionTypes } from './user.types.js';

export const setCurrentUser = user => ({
    type: UserActionTypes.SET_CURRENT_USER,
    payload: user
});

export const googleSignInStart = () => ({
    type: ShopActionTypes.GOOGLE_SIGN_IN_START
  });

  export const googleSignInSuccess = user => ({
    type: ShopActionTypes.GOOGLE_SIGN_IN_SUCCESS,
    payload: user
  });

  export const googleSignInFailure = error => ({
    type: ShopActionTypes.GOOGLE_SIGN_IN_FAILURE,
    payload: error
  });

  export const emailSignInStart = emailAndPassword => ({
    type: ShopActionTypes.EMAIL_SIGN_IN_START,
    payload: emailAndPassword
  });

  export const emailSignInSuccess = user => ({
    type: ShopActionTypes.EMAIL_SIGN_IN_SUCCESS,
    payload: user
  });

  export const emailSignInFailure = error => ({
    type: ShopActionTypes.EMAIL_SIGN_IN_FAILURE,
    payload: error
  });
